Ext.data.JsonP.java_time_format_DateTimeFormatter({"tagname":"class","name":"java.time.format.DateTimeFormatter","autodetected":{},"files":[{"filename":"DateTimeFormatter.js","href":"DateTimeFormatter.html#java-time-format-DateTimeFormatter"}],"extends":"java.lang.Object","since":"1.8","members":[{"name":"BASIC_ISO_DATE","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-BASIC_ISO_DATE","meta":{}},{"name":"ISO_DATE","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_DATE","meta":{}},{"name":"ISO_DATE_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_DATE_TIME","meta":{}},{"name":"ISO_INSTANT","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_INSTANT","meta":{}},{"name":"ISO_LOCAL_DATE","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_LOCAL_DATE","meta":{}},{"name":"ISO_LOCAL_DATE_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_LOCAL_DATE_TIME","meta":{}},{"name":"ISO_LOCAL_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_LOCAL_TIME","meta":{}},{"name":"ISO_OFFSET_DATE","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_OFFSET_DATE","meta":{}},{"name":"ISO_OFFSET_DATE_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_OFFSET_DATE_TIME","meta":{}},{"name":"ISO_OFFSET_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_OFFSET_TIME","meta":{}},{"name":"ISO_ORDINAL_DATE","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_ORDINAL_DATE","meta":{}},{"name":"ISO_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_TIME","meta":{}},{"name":"ISO_WEEK_DATE","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_WEEK_DATE","meta":{}},{"name":"ISO_ZONED_DATE_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-ISO_ZONED_DATE_TIME","meta":{}},{"name":"RFC_1123_DATE_TIME","tagname":"property","owner":"java.time.format.DateTimeFormatter","id":"property-RFC_1123_DATE_TIME","meta":{}},{"name":"format","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-format","meta":{}},{"name":"formatTo","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-formatTo","meta":{}},{"name":"getChronology","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-getChronology","meta":{}},{"name":"getDecimalStyle","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-getDecimalStyle","meta":{}},{"name":"getLocale","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-getLocale","meta":{}},{"name":"getResolverFields","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-getResolverFields","meta":{}},{"name":"getResolverStyle","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-getResolverStyle","meta":{}},{"name":"getZone","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-getZone","meta":{}},{"name":"ofLocalizedDate","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-ofLocalizedDate","meta":{}},{"name":"ofLocalizedDateTime","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-ofLocalizedDateTime","meta":{}},{"name":"ofLocalizedTime","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-ofLocalizedTime","meta":{}},{"name":"ofPattern","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-ofPattern","meta":{}},{"name":"parse","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-parse","meta":{}},{"name":"parseBest","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-parseBest","meta":{}},{"name":"parseUnresolved","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-parseUnresolved","meta":{}},{"name":"parsedExcessDays","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-parsedExcessDays","meta":{}},{"name":"parsedLeapSecond","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-parsedLeapSecond","meta":{}},{"name":"toFormat","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-toFormat","meta":{}},{"name":"toString","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-toString","meta":{}},{"name":"withChronology","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-withChronology","meta":{}},{"name":"withDecimalStyle","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-withDecimalStyle","meta":{}},{"name":"withLocale","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-withLocale","meta":{}},{"name":"withResolverFields","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-withResolverFields","meta":{}},{"name":"withResolverStyle","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-withResolverStyle","meta":{}},{"name":"withZone","tagname":"method","owner":"java.time.format.DateTimeFormatter","id":"method-withZone","meta":{}}],"alternateClassNames":[],"aliases":{},"id":"class-java.time.format.DateTimeFormatter","short_doc":"Formatter for printing and parsing date-time objects. ...","classIcon":"icon-class","superclasses":["java.lang.Object"],"subclasses":[],"mixedInto":[],"mixins":[],"parentMixins":[],"requires":[],"uses":[],"html":"<div><pre class=\"hierarchy\"><h4>Hierarchy</h4><div class='subclass first-child'>java.lang.Object<div class='subclass '><strong>java.time.format.DateTimeFormatter</strong></div></div><h4>Files</h4><div class='dependency'><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter' target='_blank'>DateTimeFormatter.js</a></div></pre><div class='doc-contents'><p>Formatter for printing and parsing date-time objects.\n <p>\n This class provides the main application entry point for printing and parsing\n and provides common implementations of {@code DateTimeFormatter}:\n <ul>\n <li>Using predefined constants, such as <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" class=\"docClass\">ISO_LOCAL_DATE</a></li>\n <li>Using pattern letters, such as {@code uuuu-MMM-dd}</li>\n <li>Using localized styles, such as {@code long} or {@code medium}</li>\n </ul>\n <p>\n More complex formatters are provided by\n <a href=\"#!/api/java.time.format.DateTimeFormatterBuilder\" rel=\"java.time.format.DateTimeFormatterBuilder\" class=\"docClass\">java.time.format.DateTimeFormatterBuilder</a>.</p>\n\n<p> <p>\n The main date-time classes provide two methods - one for formatting,\n {@code format(DateTimeFormatter formatter)}, and one for parsing,\n {@code parse(CharSequence text, DateTimeFormatter formatter)}.\n <p>For example:\n <blockquote></blockquote></p>\n\n<pre>  LocalDate date = LocalDate.now();\n  String text = date.format(formatter);\n  LocalDate parsedDate = LocalDate.parse(text, formatter);\n </pre>\n\n\n<p>\n <p>\n In addition to the format, formatters can be created with desired Locale,\n Chronology, ZoneId, and DecimalStyle.\n <p>\n The <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withLocale\" rel=\"java.time.format.DateTimeFormatter-method-withLocale\" class=\"docClass\">withLocale</a> method returns a new formatter that\n overrides the locale. The locale affects some aspects of formatting and\n parsing. For example, the <a href=\"#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedDate\" rel=\"java.time.format.DateTimeFormatter-method-ofLocalizedDate\" class=\"docClass\">ofLocalizedDate</a> provides a\n formatter that uses the locale specific date format.\n <p>\n The <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withChronology\" rel=\"java.time.format.DateTimeFormatter-method-withChronology\" class=\"docClass\">withChronology</a> method returns a new formatter\n that overrides the chronology. If overridden, the date-time value is\n converted to the chronology before formatting. During parsing the date-time\n value is converted to the chronology before it is returned.\n <p>\n The <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withZone\" rel=\"java.time.format.DateTimeFormatter-method-withZone\" class=\"docClass\">withZone</a> method returns a new formatter that overrides\n the zone. If overridden, the date-time value is converted to a ZonedDateTime\n with the requested ZoneId before formatting. During parsing the ZoneId is\n applied before the value is returned.\n <p>\n The <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withDecimalStyle\" rel=\"java.time.format.DateTimeFormatter-method-withDecimalStyle\" class=\"docClass\">withDecimalStyle</a> method returns a new formatter that\n overrides the <a href=\"#!/api/java.time.format.DecimalStyle\" rel=\"java.time.format.DecimalStyle\" class=\"docClass\">java.time.format.DecimalStyle</a>. The DecimalStyle symbols are used for\n formatting and parsing.\n <p>\n Some applications may need to use the older java.text.Format\n class for formatting. The <a href=\"#!/api/java.time.format.DateTimeFormatter-method-toFormat\" rel=\"java.time.format.DateTimeFormatter-method-toFormat\" class=\"docClass\">toFormat</a>() method returns an\n implementation of {@code java.text.Format}.</p>\n\n<p> <h3 id=\"predefined\">Predefined Formatters</h3>\n <table summary=\"Predefined Formatters\" cellpadding=\"2\" cellspacing=\"3\" border=\"0\" >\n <thead>\n <tr class=\"tableSubHeadingColor\">\n <th class=\"colFirst\" align=\"left\">Formatter</th>\n <th class=\"colFirst\" align=\"left\">Description</th>\n <th class=\"colLast\" align=\"left\">Example</th>\n </tr>\n </thead>\n <tbody>\n <tr class=\"rowColor\">\n <td><a href=\"#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedDate\" rel=\"java.time.format.DateTimeFormatter-method-ofLocalizedDate\" class=\"docClass\">ofLocalizedDate(dateStyle)</a> </td>\n <td> Formatter with date style from the locale </td>\n <td> '2011-12-03'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedTime\" rel=\"java.time.format.DateTimeFormatter-method-ofLocalizedTime\" class=\"docClass\">ofLocalizedTime(timeStyle)</a> </td>\n <td> Formatter with time style from the locale </td>\n <td> '10:15:30'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedDateTime\" rel=\"java.time.format.DateTimeFormatter-method-ofLocalizedDateTime\" class=\"docClass\">ofLocalizedDateTime(dateTimeStyle)</a> </td>\n <td> Formatter with a style for date and time from the locale</td>\n <td> '3 Jun 2008 11:05:30'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedDateTime\" rel=\"java.time.format.DateTimeFormatter-method-ofLocalizedDateTime\" class=\"docClass\">ofLocalizedDateTime(dateStyle,timeStyle)</a>\n </td>\n <td> Formatter with date and time styles from the locale </td>\n <td> '3 Jun 2008 11:05'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-BASIC_ISO_DATE\" rel=\"java.time.format.DateTimeFormatter-property-BASIC_ISO_DATE\" class=\"docClass\">BASIC_ISO_DATE</a></td>\n <td>Basic ISO date </td> <td>'20111203'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" class=\"docClass\">ISO_LOCAL_DATE</a></td>\n <td> ISO Local Date </td>\n <td>'2011-12-03'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE\" class=\"docClass\">ISO_OFFSET_DATE</a></td>\n <td> ISO Date with offset </td>\n <td>'2011-12-03+01:00'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_DATE\" class=\"docClass\">ISO_DATE</a></td>\n <td> ISO Date with or without offset </td>\n <td> '2011-12-03+01:00'; '2011-12-03'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" class=\"docClass\">ISO_LOCAL_TIME</a></td>\n <td> Time without offset </td>\n <td>'10:15:30'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_OFFSET_TIME\" class=\"docClass\">ISO_OFFSET_TIME</a></td>\n <td> Time with offset </td>\n <td>'10:15:30+01:00'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_TIME\" class=\"docClass\">ISO_TIME</a></td>\n <td> Time with or without offset </td>\n <td>'10:15:30+01:00'; '10:15:30'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME\" class=\"docClass\">ISO_LOCAL_DATE_TIME</a></td>\n <td> ISO Local Date and Time </td>\n <td>'2011-12-03T10:15:30'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME\" class=\"docClass\">ISO_OFFSET_DATE_TIME</a></td>\n <td> Date Time with Offset\n </td><td>2011-12-03T10:15:30+01:00'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_ZONED_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_ZONED_DATE_TIME\" class=\"docClass\">ISO_ZONED_DATE_TIME</a></td>\n <td> Zoned Date Time </td>\n <td>'2011-12-03T10:15:30+01:00[Europe/Paris]'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_DATE_TIME\" class=\"docClass\">ISO_DATE_TIME</a></td>\n <td> Date and time with ZoneId </td>\n <td>'2011-12-03T10:15:30+01:00[Europe/Paris]'</td>\n </tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_ORDINAL_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_ORDINAL_DATE\" class=\"docClass\">ISO_ORDINAL_DATE</a></td>\n <td> Year and day of year </td>\n <td>'2012-337'</td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_WEEK_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_WEEK_DATE\" class=\"docClass\">ISO_WEEK_DATE</a></td>\n <td> Year and Week </td>\n <td>2012-W48-6'</td></tr>\n <tr class=\"altColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_INSTANT\" rel=\"java.time.format.DateTimeFormatter-property-ISO_INSTANT\" class=\"docClass\">ISO_INSTANT</a></td>\n <td> Date and Time of an Instant </td>\n <td>'2011-12-03T10:15:30Z' </td>\n </tr>\n <tr class=\"rowColor\">\n <td> <a href=\"#!/api/java.time.format.DateTimeFormatter-property-RFC_1123_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-RFC_1123_DATE_TIME\" class=\"docClass\">RFC_1123_DATE_TIME</a></td>\n <td> RFC 1123 / RFC 822 </td>\n <td>'Tue, 3 Jun 2008 11:05:30 GMT'</td>\n </tr>\n </tbody>\n </table></p>\n\n<p> <h3 id=\"patterns\">Patterns for Formatting and Parsing</h3>\n Patterns are based on a simple sequence of letters and symbols.\n A pattern is used to create a Formatter using the\n <a href=\"#!/api/java.time.format.DateTimeFormatter-method-ofPattern\" rel=\"java.time.format.DateTimeFormatter-method-ofPattern\" class=\"docClass\">ofPattern</a>(String) and Locale) methods.\n For example,\n {@code \"d MMM uuuu\"} will format 2011-12-03 as '3&nbsp;Dec&nbsp;2011'.\n A formatter created from a pattern can be used as many times as necessary,\n it is immutable and is thread-safe.\n <p>\n For example:\n <blockquote></blockquote></p>\n\n<pre>  LocalDate date = LocalDate.now();\n  DateTimeFormatter formatter = DateTimeFormatter.ofPattern(\"yyyy MM dd\");\n  String text = date.format(formatter);\n  LocalDate parsedDate = LocalDate.parse(text, formatter);\n </pre>\n\n\n<p>\n <p>\n All letters 'A' to 'Z' and 'a' to 'z' are reserved as pattern letters. The\n following pattern letters are defined:</p>\n\n<pre>  Symbol  Meaning                     Presentation      Examples\n  ------  -------                     ------------      -------\n   G       era                         text              AD; Anno Domini; A\n   u       year                        year              2004; 04\n   y       year-of-era                 year              2004; 04\n   D       day-of-year                 number            189\n   M/L     month-of-year               number/text       7; 07; Jul; July; J\n   d       day-of-month                number            10\n\n   Q/q     quarter-of-year             number/text       3; 03; Q3; 3rd quarter\n   Y       week-based-year             year              1996; 96\n   w       week-of-week-based-year     number            27\n   W       week-of-month               number            4\n   E       day-of-week                 text              Tue; Tuesday; T\n   e/c     localized day-of-week       number/text       2; 02; Tue; Tuesday; T\n   F       week-of-month               number            3\n\n   a       am-pm-of-day                text              PM\n   h       clock-hour-of-am-pm (1-12)  number            12\n   K       hour-of-am-pm (0-11)        number            0\n   k       clock-hour-of-am-pm (1-24)  number            0\n\n   H       hour-of-day (0-23)          number            0\n   m       minute-of-hour              number            30\n   s       second-of-minute            number            55\n   S       fraction-of-second          fraction          978\n   A       milli-of-day                number            1234\n   n       nano-of-second              number            987654321\n   N       nano-of-day                 number            1234000000\n\n   V       time-zone ID                zone-id           America/Los_Angeles; Z; -08:30\n   z       time-zone name              zone-name         Pacific Standard Time; PST\n   O       localized zone-offset       offset-O          GMT+8; GMT+08:00; UTC-08:00;\n   X       zone-offset 'Z' for zero    offset-X          Z; -08; -0830; -08:30; -083015; -08:30:15;\n   x       zone-offset                 offset-x          +0000; -08; -0830; -08:30; -083015; -08:30:15;\n   Z       zone-offset                 offset-Z          +0000; -0800; -08:00;\n\n   p       pad next                    pad modifier      1\n\n   '       escape for text             delimiter\n   ''      single quote                literal           '\n   [       optional section start\n   ]       optional section end\n   #       reserved for future use\n   {       reserved for future use\n   }       reserved for future use\n </pre>\n\n\n<p> <p>\n The count of pattern letters determines the format.\n <p>\n <b>Text</b>: The text style is determined based on the number of pattern\n letters used. Less than 4 pattern letters will use the\n <a href=\"#!/api/java.time.format.TextStyle-property-SHORT\" rel=\"java.time.format.TextStyle-property-SHORT\" class=\"docClass\">short form</a>. Exactly 4 pattern letters will use the\n <a href=\"#!/api/java.time.format.TextStyle-property-FULL\" rel=\"java.time.format.TextStyle-property-FULL\" class=\"docClass\">full form</a>. Exactly 5 pattern letters will use the\n <a href=\"#!/api/java.time.format.TextStyle-property-NARROW\" rel=\"java.time.format.TextStyle-property-NARROW\" class=\"docClass\">narrow form</a>.\n Pattern letters 'L', 'c', and 'q' specify the stand-alone form of the text styles.\n <p>\n <b>Number</b>: If the count of letters is one, then the value is output using\n the minimum number of digits and without padding. Otherwise, the count of digits\n is used as the width of the output field, with the value zero-padded as necessary.\n The following pattern letters have constraints on the count of letters.\n Only one letter of 'c' and 'F' can be specified.\n Up to two letters of 'd', 'H', 'h', 'K', 'k', 'm', and 's' can be specified.\n Up to three letters of 'D' can be specified.\n <p>\n <b>Number/Text</b>: If the count of pattern letters is 3 or greater, use the\n Text rules above. Otherwise use the Number rules above.\n <p>\n <b>Fraction</b>: Outputs the nano-of-second field as a fraction-of-second.\n The nano-of-second value has nine digits, thus the count of pattern letters\n is from 1 to 9. If it is less than 9, then the nano-of-second value is\n truncated, with only the most significant digits being output.\n <p>\n <b>Year</b>: The count of letters determines the minimum field width below\n which padding is used. If the count of letters is two, then a\n <a href=\"#!/api/java.time.format.DateTimeFormatterBuilder-method-appendValueReduced\" rel=\"java.time.format.DateTimeFormatterBuilder-method-appendValueReduced\" class=\"docClass\">reduced</a> two digit form is\n used. For printing, this outputs the rightmost two digits. For parsing, this\n will parse using the base value of 2000, resulting in a year within the range\n 2000 to 2099 inclusive. If the count of letters is less than four (but not\n two), then the sign is only output for negative years as per\n <a href=\"#!/api/java.time.format.SignStyle-property-NORMAL\" rel=\"java.time.format.SignStyle-property-NORMAL\" class=\"docClass\">java.time.format.SignStyle.NORMAL</a>. Otherwise, the sign is output if the pad width is\n exceeded, as per <a href=\"#!/api/java.time.format.SignStyle-property-EXCEEDS_PAD\" rel=\"java.time.format.SignStyle-property-EXCEEDS_PAD\" class=\"docClass\">java.time.format.SignStyle.EXCEEDS_PAD</a>.\n <p>\n <b>ZoneId</b>: This outputs the time-zone ID, such as 'Europe/Paris'. If the\n count of letters is two, then the time-zone ID is output. Any other count of\n letters throws {@code IllegalArgumentException}.\n <p>\n <b>Zone names</b>: This outputs the display name of the time-zone ID. If the\n count of letters is one, two or three, then the short name is output. If the\n count of letters is four, then the full name is output. Five or more letters\n throws {@code IllegalArgumentException}.\n <p>\n <b>Offset X and x</b>: This formats the offset based on the number of pattern\n letters. One letter outputs just the hour, such as '+01', unless the minute\n is non-zero in which case the minute is also output, such as '+0130'. Two\n letters outputs the hour and minute, without a colon, such as '+0130'. Three\n letters outputs the hour and minute, with a colon, such as '+01:30'. Four\n letters outputs the hour and minute and optional second, without a colon,\n such as '+013015'. Five letters outputs the hour and minute and optional\n second, with a colon, such as '+01:30:15'. Six or more letters throws\n {@code IllegalArgumentException}. Pattern letter 'X' (upper case) will output\n 'Z' when the offset to be output would be zero, whereas pattern letter 'x'\n (lower case) will output '+00', '+0000', or '+00:00'.\n <p>\n <b>Offset O</b>: This formats the localized offset based on the number of\n pattern letters. One letter outputs the {@linkplain <a href=\"#!/api/java.time.format.TextStyle-property-SHORT\" rel=\"java.time.format.TextStyle-property-SHORT\" class=\"docClass\">java.time.format.TextStyle.SHORT</a> short}\n form of the localized offset, which is localized offset text, such as 'GMT',\n with hour without leading zero, optional 2-digit minute and second if\n non-zero, and colon, for example 'GMT+8'. Four letters outputs the\n {@linkplain <a href=\"#!/api/java.time.format.TextStyle-property-FULL\" rel=\"java.time.format.TextStyle-property-FULL\" class=\"docClass\">java.time.format.TextStyle.FULL</a> full} form, which is localized offset text,\n such as 'GMT, with 2-digit hour and minute field, optional second field\n if non-zero, and colon, for example 'GMT+08:00'. Any other count of letters\n throws {@code IllegalArgumentException}.\n <p>\n <b>Offset Z</b>: This formats the offset based on the number of pattern\n letters. One, two or three letters outputs the hour and minute, without a\n colon, such as '+0130'. The output will be '+0000' when the offset is zero.\n Four letters outputs the {@linkplain <a href=\"#!/api/java.time.format.TextStyle-property-FULL\" rel=\"java.time.format.TextStyle-property-FULL\" class=\"docClass\">java.time.format.TextStyle.FULL</a> full} form of localized\n offset, equivalent to four letters of Offset-O. The output will be the\n corresponding localized offset text if the offset is zero. Five\n letters outputs the hour, minute, with optional second if non-zero, with\n colon. It outputs 'Z' if the offset is zero.\n Six or more letters throws {@code IllegalArgumentException}.\n <p>\n <b>Optional section</b>: The optional section markers work exactly like\n calling java.time.format.DateTimeFormatterBuilder.optionalStart() and\n java.time.format.DateTimeFormatterBuilder.optionalEnd().\n <p>\n <b>Pad modifier</b>: Modifies the pattern that immediately follows to be\n padded with spaces. The pad width is determined by the number of pattern\n letters. This is the same as calling\n java.time.format.DateTimeFormatterBuilder.padNext(int).\n <p>\n For example, 'ppH' outputs the hour-of-day padded on the left with spaces to\n a width of 2.\n <p>\n Any unrecognized letter is an error. Any non-letter character, other than\n '[', ']', '{', '}', '#' and the single quote will be output directly.\n Despite this, it is recommended to use single quotes around all characters\n that you want to output directly to ensure that future changes do not break\n your application.</p>\n\n<p> <h3 id=\"resolving\">Resolving</h3>\n Parsing is implemented as a two-phase operation.\n First, the text is parsed using the layout defined by the formatter, producing\n a {@code Map} of field to value, a {@code ZoneId} and a {@code Chronology}.\n Second, the parsed data is <em>resolved</em>, by validating, combining and\n simplifying the various fields into more useful ones.\n <p>\n Five parsing methods are supplied by this class.\n Four of these perform both the parse and resolve phases.\n The fifth method, ParsePosition),\n only performs the first phase, leaving the result unresolved.\n As such, it is essentially a low-level operation.\n <p>\n The resolve phase is controlled by two parameters, set on this class.\n <p>\n The <a href=\"#!/api/java.time.format.ResolverStyle\" rel=\"java.time.format.ResolverStyle\" class=\"docClass\">java.time.format.ResolverStyle</a> is an enum that offers three different approaches,\n strict, smart and lenient. The smart option is the default.\n It can be set using <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withResolverStyle\" rel=\"java.time.format.DateTimeFormatter-method-withResolverStyle\" class=\"docClass\">withResolverStyle</a>(ResolverStyle).\n <p>\n The withResolverFields(TemporalField...) parameter allows the\n set of fields that will be resolved to be filtered before resolving starts.\n For example, if the formatter has parsed a year, month, day-of-month\n and day-of-year, then there are two approaches to resolve a date:\n (year + month + day-of-month) and (year + day-of-year).\n The resolver fields allows one of the two approaches to be selected.\n If no resolver fields are set then both approaches must result in the same date.\n <p>\n Resolving separate fields to form a complete date and time is a complex\n process with behaviour distributed across a number of classes.\n It follows these steps:\n <ol>\n <li>The chronology is determined.\n The chronology of the result is either the chronology that was parsed,\n or if no chronology was parsed, it is the chronology set on this class,\n or if that is null, it is {@code IsoChronology}.\n <li>The {@code ChronoField} date fields are resolved.\n This is achieved using java.time.format.ResolverStyle).\n Documentation about field resolution is located in the implementation\n of {@code Chronology}.\n <li>The {@code ChronoField} time fields are resolved.\n This is documented on ChronoField and is the same for all chronologies.\n <li>Any fields that are not {@code ChronoField} are processed.\n This is achieved using TemporalAccessor, java.time.format.ResolverStyle).\n Documentation about field resolution is located in the implementation\n of {@code TemporalField}.\n <li>The {@code ChronoField} date and time fields are re-resolved.\n This allows fields in step four to produce {@code ChronoField} values\n and have them be processed into dates and times.\n <li>A {@code LocalTime} is formed if there is at least an hour-of-day available.\n This involves providing default values for minute, second and fraction of second.\n <li>Any remaining unresolved fields are cross-checked against any\n date and/or time that was resolved. Thus, an earlier stage would resolve\n (year + month + day-of-month) to a date, and this stage would check that\n day-of-week was valid for the date.\n <li>If an {@linkplain <a href=\"#!/api/java.time.format.DateTimeFormatter-method-parsedExcessDays\" rel=\"java.time.format.DateTimeFormatter-method-parsedExcessDays\" class=\"docClass\">parsedExcessDays</a>() excess number of days}\n was parsed then it is added to the date if a date is available.\n </li></li></li></li></li></li></li></li></ol></p>\n\n<p> @implSpec\n This class is immutable and thread-safe.</p>\n        <p>Available since: <b>1.8</b></p>\n</div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-BASIC_ISO_DATE' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-BASIC_ISO_DATE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-BASIC_ISO_DATE' class='name expandable'>BASIC_ISO_DATE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date formatter that formats or parses a date without an\noffset, such as '20111203'. ...</div><div class='long'><p>The ISO date formatter that formats or parses a date without an\noffset, such as '20111203'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 basic local date format.\nThe format consists of:\n<ul>\n<li>Four digits for the year.\n Only years in the range 0000 to 9999 are supported.\n<li>Two digits for the month-of-year.\n This is pre-padded by zero to ensure two digits.\n<li>Two digits for the day-of-month.\n This is pre-padded by zero to ensure two digits.\n<li>If the offset is not available to format or parse then the format is complete.\n<li>The offset ID without colons. If the offset has\n seconds then they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></li></li></li></ul>\n<p>\nAs this formatter has an optional element, it may be necessary to parse using\n<a href=\"#!/api/java.time.format.DateTimeFormatter-method-parseBest\" rel=\"java.time.format.DateTimeFormatter-method-parseBest\" class=\"docClass\">parseBest</a>.\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_DATE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_DATE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_DATE' class='name expandable'>ISO_DATE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date formatter that formats or parses a date with the\noffset if available, such as '2011-12-03' or '2011-12-0...</div><div class='long'><p>The ISO date formatter that formats or parses a date with the\noffset if available, such as '2011-12-03' or '2011-12-03+01:00'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended date format.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" class=\"docClass\">ISO_LOCAL_DATE</a>\n<li>If the offset is not available then the format is complete.\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></li></ul>\n<p>\nAs this formatter has an optional element, it may be necessary to parse using\n<a href=\"#!/api/java.time.format.DateTimeFormatter-method-parseBest\" rel=\"java.time.format.DateTimeFormatter-method-parseBest\" class=\"docClass\">parseBest</a>.\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_DATE_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_DATE_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_DATE_TIME' class='name expandable'>ISO_DATE_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO-like date-time formatter that formats or parses a date-time with\nthe offset and zone if available, such as '2...</div><div class='long'><p>The ISO-like date-time formatter that formats or parses a date-time with\nthe offset and zone if available, such as '2011-12-03T10:15:30',\n'2011-12-03T10:15:30+01:00' or '2011-12-03T10:15:30+01:00[Europe/Paris]'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended local or offset date-time format, as well as the\nextended non-ISO form specifying the time-zone.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME\" class=\"docClass\">ISO_LOCAL_DATE_TIME</a>\n<li>If the offset is not available to format or parse then the format is complete.\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n<li>If the zone ID is not available or is a {@code ZoneOffset} then the format is complete.\n<li>An open square bracket '['.\n<li>The zone ID. This is not part of the ISO-8601 standard.\n Parsing is case sensitive.\n<li>A close square bracket ']'.\n</li></li></li></li></li></li></li></ul>\n<p>\nAs this formatter has an optional element, it may be necessary to parse using\n<a href=\"#!/api/java.time.format.DateTimeFormatter-method-parseBest\" rel=\"java.time.format.DateTimeFormatter-method-parseBest\" class=\"docClass\">parseBest</a>.\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_INSTANT' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_INSTANT' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_INSTANT' class='name expandable'>ISO_INSTANT</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO instant formatter that formats or parses an instant in UTC,\nsuch as '2011-12-03T10:15:30Z'. ...</div><div class='long'><p>The ISO instant formatter that formats or parses an instant in UTC,\nsuch as '2011-12-03T10:15:30Z'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 instant format.\nWhen formatting, the second-of-minute is always output.\nThe nano-of-second outputs zero, three, six or nine digits digits as necessary.\nWhen parsing, time to at least the seconds field is required.\nFractional seconds from zero to nine are parsed.\nThe localized decimal style is not used.\n<p>\nThis is a special case formatter intended to allow a human readable form\nof an java.time.Instant. The {@code Instant} class is designed to\nonly represent a point in time and internally stores a value in nanoseconds\nfrom a fixed epoch of 1970-01-01Z. As such, an {@code Instant} cannot be\nformatted as a date or time without providing some form of time-zone.\nThis formatter allows the {@code Instant} to be formatted, by providing\na suitable conversion using {@code ZoneOffset.UTC}.\n<p>\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME\" class=\"docClass\">ISO_OFFSET_DATE_TIME</a> where the instant is converted from\n ChronoField.INSTANT_SECONDS and ChronoField.NANO_OF_SECOND\n using the {@code UTC} offset. Parsing is case insensitive.\n</li></ul>\n<p>\nThe returned formatter has no override chronology or zone.\nIt uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_LOCAL_DATE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_LOCAL_DATE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE' class='name expandable'>ISO_LOCAL_DATE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date formatter that formats or parses a date without an\noffset, such as '2011-12-03'. ...</div><div class='long'><p>The ISO date formatter that formats or parses a date without an\noffset, such as '2011-12-03'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended local date format.\nThe format consists of:\n<ul>\n<li>Four digits or more for the year.\nYears in the range 0000 to 9999 will be pre-padded by zero to ensure four digits.\nYears outside that range will have a prefixed positive or negative symbol.\n<li>A dash\n<li>Two digits for the month-of-year.\n This is pre-padded by zero to ensure two digits.\n<li>A dash\n<li>Two digits for the day-of-month.\n This is pre-padded by zero to ensure two digits.\n</li></li></li></li></li></ul>\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_LOCAL_DATE_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_LOCAL_DATE_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME' class='name expandable'>ISO_LOCAL_DATE_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date-time formatter that formats or parses a date-time without\nan offset, such as '2011-12-03T10:15:30'. ...</div><div class='long'><p>The ISO date-time formatter that formats or parses a date-time without\nan offset, such as '2011-12-03T10:15:30'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended offset date-time format.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" class=\"docClass\">ISO_LOCAL_DATE</a>\n<li>The letter 'T'. Parsing is case insensitive.\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" class=\"docClass\">ISO_LOCAL_TIME</a>\n</li></li></li></ul>\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_LOCAL_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_LOCAL_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME' class='name expandable'>ISO_LOCAL_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO time formatter that formats or parses a time without an\noffset, such as '10:15' or '10:15:30'. ...</div><div class='long'><p>The ISO time formatter that formats or parses a time without an\noffset, such as '10:15' or '10:15:30'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended local time format.\nThe format consists of:\n<ul>\n<li>Two digits for the hour-of-day.\n This is pre-padded by zero to ensure two digits.\n<li>A colon\n<li>Two digits for the minute-of-hour.\n This is pre-padded by zero to ensure two digits.\n<li>If the second-of-minute is not available then the format is complete.\n<li>A colon\n<li>Two digits for the second-of-minute.\n This is pre-padded by zero to ensure two digits.\n<li>If the nano-of-second is zero or not available then the format is complete.\n<li>A decimal point\n<li>One to nine digits for the nano-of-second.\n As many digits will be output as required.\n</li></li></li></li></li></li></li></li></li></ul>\n<p>\nThe returned formatter has no override chronology or zone.\nIt uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_OFFSET_DATE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_OFFSET_DATE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE' class='name expandable'>ISO_OFFSET_DATE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date formatter that formats or parses a date with an\noffset, such as '2011-12-03+01:00'. ...</div><div class='long'><p>The ISO date formatter that formats or parses a date with an\noffset, such as '2011-12-03+01:00'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended offset date format.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE\" class=\"docClass\">ISO_LOCAL_DATE</a>\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></ul>\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_OFFSET_DATE_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_OFFSET_DATE_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME' class='name expandable'>ISO_OFFSET_DATE_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date-time formatter that formats or parses a date-time with an\noffset, such as '2011-12-03T10:15:30+01:00'. ...</div><div class='long'><p>The ISO date-time formatter that formats or parses a date-time with an\noffset, such as '2011-12-03T10:15:30+01:00'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended offset date-time format.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_DATE_TIME\" class=\"docClass\">ISO_LOCAL_DATE_TIME</a>\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></ul>\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_OFFSET_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_OFFSET_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_TIME' class='name expandable'>ISO_OFFSET_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO time formatter that formats or parses a time with an\noffset, such as '10:15+01:00' or '10:15:30+01:00'. ...</div><div class='long'><p>The ISO time formatter that formats or parses a time with an\noffset, such as '10:15+01:00' or '10:15:30+01:00'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended offset time format.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" class=\"docClass\">ISO_LOCAL_TIME</a>\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></ul>\n<p>\nThe returned formatter has no override chronology or zone.\nIt uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_ORDINAL_DATE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_ORDINAL_DATE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_ORDINAL_DATE' class='name expandable'>ISO_ORDINAL_DATE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date formatter that formats or parses the ordinal date\nwithout an offset, such as '2012-337'. ...</div><div class='long'><p>The ISO date formatter that formats or parses the ordinal date\nwithout an offset, such as '2012-337'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended ordinal date format.\nThe format consists of:\n<ul>\n<li>Four digits or more for the year.\nYears in the range 0000 to 9999 will be pre-padded by zero to ensure four digits.\nYears outside that range will have a prefixed positive or negative symbol.\n<li>A dash\n<li>Three digits for the day-of-year.\n This is pre-padded by zero to ensure three digits.\n<li>If the offset is not available to format or parse then the format is complete.\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></li></li></li></ul>\n<p>\nAs this formatter has an optional element, it may be necessary to parse using\n<a href=\"#!/api/java.time.format.DateTimeFormatter-method-parseBest\" rel=\"java.time.format.DateTimeFormatter-method-parseBest\" class=\"docClass\">parseBest</a>.\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_TIME' class='name expandable'>ISO_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO time formatter that formats or parses a time, with the\noffset if available, such as '10:15', '10:15:30' or '1...</div><div class='long'><p>The ISO time formatter that formats or parses a time, with the\noffset if available, such as '10:15', '10:15:30' or '10:15:30+01:00'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended offset time format.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_LOCAL_TIME\" class=\"docClass\">ISO_LOCAL_TIME</a>\n<li>If the offset is not available then the format is complete.\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></li></ul>\n<p>\nAs this formatter has an optional element, it may be necessary to parse using\n<a href=\"#!/api/java.time.format.DateTimeFormatter-method-parseBest\" rel=\"java.time.format.DateTimeFormatter-method-parseBest\" class=\"docClass\">parseBest</a>.\n<p>\nThe returned formatter has no override chronology or zone.\nIt uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_WEEK_DATE' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_WEEK_DATE' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_WEEK_DATE' class='name expandable'>ISO_WEEK_DATE</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO date formatter that formats or parses the week-based date\nwithout an offset, such as '2012-W48-6'. ...</div><div class='long'><p>The ISO date formatter that formats or parses the week-based date\nwithout an offset, such as '2012-W48-6'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nthe ISO-8601 extended week-based date format.\nThe format consists of:\n<ul>\n<li>Four digits or more for the week-based-year.\nYears in the range 0000 to 9999 will be pre-padded by zero to ensure four digits.\nYears outside that range will have a prefixed positive or negative symbol.\n<li>A dash\n<li>The letter 'W'. Parsing is case insensitive.\n<li>Two digits for the week-of-week-based-year.\n This is pre-padded by zero to ensure three digits.\n<li>A dash\n<li>One digit for the day-of-week.\n The value run from Monday (1) to Sunday (7).\n<li>If the offset is not available to format or parse then the format is complete.\n<li>The offset ID. If the offset has seconds then\n they will be handled even though this is not part of the ISO-8601 standard.\n Parsing is case insensitive.\n</li></li></li></li></li></li></li></li></ul>\n<p>\nAs this formatter has an optional element, it may be necessary to parse using\n<a href=\"#!/api/java.time.format.DateTimeFormatter-method-parseBest\" rel=\"java.time.format.DateTimeFormatter-method-parseBest\" class=\"docClass\">parseBest</a>.\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-ISO_ZONED_DATE_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-ISO_ZONED_DATE_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-ISO_ZONED_DATE_TIME' class='name expandable'>ISO_ZONED_DATE_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The ISO-like date-time formatter that formats or parses a date-time with\noffset and zone, such as '2011-12-03T10:15:3...</div><div class='long'><p>The ISO-like date-time formatter that formats or parses a date-time with\noffset and zone, such as '2011-12-03T10:15:30+01:00[Europe/Paris]'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\na format that extends the ISO-8601 extended offset date-time format\nto add the time-zone.\nThe section in square brackets is not part of the ISO-8601 standard.\nThe format consists of:\n<ul>\n<li>The <a href=\"#!/api/java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME\" rel=\"java.time.format.DateTimeFormatter-property-ISO_OFFSET_DATE_TIME\" class=\"docClass\">ISO_OFFSET_DATE_TIME</a>\n<li>If the zone ID is not available or is a {@code ZoneOffset} then the format is complete.\n<li>An open square bracket '['.\n<li>The zone ID. This is not part of the ISO-8601 standard.\n Parsing is case sensitive.\n<li>A close square bracket ']'.\n</li></li></li></li></li></ul>\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-STRICT\" rel=\"java.time.format.ResolverStyle-property-STRICT\" class=\"docClass\">STRICT</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div><div id='property-RFC_1123_DATE_TIME' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-property-RFC_1123_DATE_TIME' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-property-RFC_1123_DATE_TIME' class='name expandable'>RFC_1123_DATE_TIME</a> : String<span class=\"signature\"></span></div><div class='description'><div class='short'>The RFC-1123 date-time formatter, such as 'Tue, 3 Jun 2008 11:05:30 GMT'. ...</div><div class='long'><p>The RFC-1123 date-time formatter, such as 'Tue, 3 Jun 2008 11:05:30 GMT'.</p>\n\n<p><p>\nThis returns an immutable formatter capable of formatting and parsing\nmost of the RFC-1123 format.\nRFC-1123 updates RFC-822 changing the year from two digits to four.\nThis implementation requires a four digit year.\nThis implementation also does not handle North American or military zone\nnames, only 'GMT' and offset amounts.\n<p>\nThe format consists of:\n<ul>\n<li>If the day-of-week is not available to format or parse then jump to day-of-month.\n<li>Three letter day-of-week in English.\n<li>A comma\n<li>A space\n<li>One or two digits for the day-of-month.\n<li>A space\n<li>Three letter month-of-year in English.\n<li>A space\n<li>Four digits for the year.\n Only years in the range 0000 to 9999 are supported.\n<li>A space\n<li>Two digits for the hour-of-day.\n This is pre-padded by zero to ensure two digits.\n<li>A colon\n<li>Two digits for the minute-of-hour.\n This is pre-padded by zero to ensure two digits.\n<li>If the second-of-minute is not available then jump to the next space.\n<li>A colon\n<li>Two digits for the second-of-minute.\n This is pre-padded by zero to ensure two digits.\n<li>A space\n<li>The offset ID without colons or seconds.\n An offset of zero uses \"GMT\". North American zone names and military zone names are not handled.\n</li></li></li></li></li></li></li></li></li></li></li></li></li></li></li></li></li></li></ul>\n<p>\nParsing is case insensitive.\n<p>\nThe returned formatter has a chronology of ISO set to ensure dates in\nother calendar systems are correctly converted.\nIt has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.</p>\n<p>Defaults to: <code>&quot;null&quot;</code></p></div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-format' class='member first-child not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-format' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-format' class='name expandable'>format</a>( <span class='pre'>temporal</span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Formats a date-time object using this formatter. ...</div><div class='long'><p>Formats a date-time object using this formatter.\n <p>\n This formats the date-time to a String using the rules of the formatter.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>temporal</span> : Object {TemporalAccessor}<div class='sub-desc'><p>the temporal object to format, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>the formatted string, not null</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>DateTimeException if an error occurs during formatting</p>\n</div></li></ul></div></div></div><div id='method-formatTo' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-formatTo' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-formatTo' class='name expandable'>formatTo</a>( <span class='pre'>temporal, appendable</span> )<span class=\"signature\"></span></div><div class='description'><div class='short'>Formats a date-time object to an {@code Appendable} using this formatter. ...</div><div class='long'><p>Formats a date-time object to an {@code Appendable} using this formatter.\n <p>\n This outputs the formatted date-time to the specified destination.\n Appendable is a general purpose interface that is implemented by all\n key character output classes including {@code StringBuffer}, {@code StringBuilder},\n {@code PrintStream} and {@code Writer}.\n <p>\n Although {@code Appendable} methods throw an {@code IOException}, this method does not.\n Instead, any {@code IOException} is wrapped in a runtime exception.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>temporal</span> : Object {TemporalAccessor}<div class='sub-desc'><p>the temporal object to format, not null</p>\n</div></li><li><span class='pre'>appendable</span> : Object {Appendable}<div class='sub-desc'><p>the appendable to format to, not null</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>DateTimeException if an error occurs during formatting</p>\n</div></li></ul></div></div></div><div id='method-getChronology' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-getChronology' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-getChronology' class='name expandable'>getChronology</a>( <span class='pre'></span> ) : Object {java.time.chrono.Chronology}<span class=\"signature\"></span></div><div class='description'><div class='short'>Gets the overriding chronology to be used during formatting. ...</div><div class='long'><p>Gets the overriding chronology to be used during formatting.\n <p>\n This returns the override chronology, used to convert dates.\n By default, a formatter has no override chronology, returning null.\n See <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withChronology\" rel=\"java.time.format.DateTimeFormatter-method-withChronology\" class=\"docClass\">withChronology</a>(Chronology) for more details on overriding.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.chrono.Chronology}</span><div class='sub-desc'><p>the override chronology of this formatter, null if no override</p>\n</div></li></ul></div></div></div><div id='method-getDecimalStyle' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-getDecimalStyle' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-getDecimalStyle' class='name expandable'>getDecimalStyle</a>( <span class='pre'></span> ) : Object {java.time.format.DecimalStyle}<span class=\"signature\"></span></div><div class='description'><div class='short'>Gets the DecimalStyle to be used during formatting. ...</div><div class='long'><p>Gets the DecimalStyle to be used during formatting.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DecimalStyle}</span><div class='sub-desc'><p>the locale of this formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-getLocale' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-getLocale' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-getLocale' class='name expandable'>getLocale</a>( <span class='pre'></span> ) : Object {java.util.Locale}<span class=\"signature\"></span></div><div class='description'><div class='short'>Gets the locale to be used during formatting. ...</div><div class='long'><p>Gets the locale to be used during formatting.\n <p>\n This is used to lookup any part of the formatter needing specific\n localization, such as the text or localized pattern.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.util.Locale}</span><div class='sub-desc'><p>the locale of this formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-getResolverFields' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-getResolverFields' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-getResolverFields' class='name expandable'>getResolverFields</a>( <span class='pre'></span> ) : Object {java.util.Set}<span class=\"signature\"></span></div><div class='description'><div class='short'>Gets the resolver fields to use during parsing. ...</div><div class='long'><p>Gets the resolver fields to use during parsing.\n <p>\n This returns the resolver fields, used during the second phase of parsing\n when fields are resolved into dates and times.\n By default, a formatter has no resolver fields, and thus returns null.\n See <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withResolverFields\" rel=\"java.time.format.DateTimeFormatter-method-withResolverFields\" class=\"docClass\">withResolverFields</a>(Set) for more details.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.util.Set}</span><div class='sub-desc'><p>the immutable set of resolver fields of this formatter, null if no fields</p>\n</div></li></ul></div></div></div><div id='method-getResolverStyle' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-getResolverStyle' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-getResolverStyle' class='name expandable'>getResolverStyle</a>( <span class='pre'></span> ) : Object {java.time.format.ResolverStyle}<span class=\"signature\"></span></div><div class='description'><div class='short'>Gets the resolver style to use during parsing. ...</div><div class='long'><p>Gets the resolver style to use during parsing.\n <p>\n This returns the resolver style, used during the second phase of parsing\n when fields are resolved into dates and times.\n By default, a formatter has the <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.\n See <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withResolverStyle\" rel=\"java.time.format.DateTimeFormatter-method-withResolverStyle\" class=\"docClass\">withResolverStyle</a>(ResolverStyle) for more details.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.ResolverStyle}</span><div class='sub-desc'><p>the resolver style of this formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-getZone' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-getZone' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-getZone' class='name expandable'>getZone</a>( <span class='pre'></span> ) : Object {java.time.ZoneId}<span class=\"signature\"></span></div><div class='description'><div class='short'>Gets the overriding zone to be used during formatting. ...</div><div class='long'><p>Gets the overriding zone to be used during formatting.\n <p>\n This returns the override zone, used to convert instants.\n By default, a formatter has no override zone, returning null.\n See <a href=\"#!/api/java.time.format.DateTimeFormatter-method-withZone\" rel=\"java.time.format.DateTimeFormatter-method-withZone\" class=\"docClass\">withZone</a>(ZoneId) for more details on overriding.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.ZoneId}</span><div class='sub-desc'><p>the override zone of this formatter, null if no override</p>\n</div></li></ul></div></div></div><div id='method-ofLocalizedDate' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-ofLocalizedDate' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedDate' class='name expandable'>ofLocalizedDate</a>( <span class='pre'>dateStyle</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a locale specific date format for the ISO chronology. ...</div><div class='long'><p>Returns a locale specific date format for the ISO chronology.\n <p>\n This returns a formatter that will format or parse a date.\n The exact format pattern used varies by locale.\n <p>\n The locale is determined from the formatter. The formatter returned directly by\n this method will use the default FORMAT locale.\n The locale can be controlled using withLocale(Locale)\n on the result of this method.\n <p>\n Note that the localized pattern is looked up lazily.\n This {@code DateTimeFormatter} holds the style required and the locale,\n looking up the pattern required on demand.\n <p>\n The returned formatter has a chronology of ISO set to ensure dates in\n other calendar systems are correctly converted.\n It has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>dateStyle</span> : Object {FormatStyle}<div class='sub-desc'><p>the formatter style to obtain, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>the date formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-ofLocalizedDateTime' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-ofLocalizedDateTime' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedDateTime' class='name expandable'>ofLocalizedDateTime</a>( <span class='pre'>dateStyle, timeStyle</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a locale specific date and time format for the ISO chronology. ...</div><div class='long'><p>Returns a locale specific date and time format for the ISO chronology.\n <p>\n This returns a formatter that will format or parse a date-time.\n The exact format pattern used varies by locale.\n <p>\n The locale is determined from the formatter. The formatter returned directly by\n this method will use the default FORMAT locale.\n The locale can be controlled using withLocale(Locale)\n on the result of this method.\n <p>\n Note that the localized pattern is looked up lazily.\n This {@code DateTimeFormatter} holds the style required and the locale,\n looking up the pattern required on demand.\n <p>\n The returned formatter has a chronology of ISO set to ensure dates in\n other calendar systems are correctly converted.\n It has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>dateStyle</span> : Object {FormatStyle}<div class='sub-desc'><p>the date formatter style to obtain, not null</p>\n</div></li><li><span class='pre'>timeStyle</span> : Object {FormatStyle}<div class='sub-desc'><p>the time formatter style to obtain, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>the date, time or date-time formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-ofLocalizedTime' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-ofLocalizedTime' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-ofLocalizedTime' class='name expandable'>ofLocalizedTime</a>( <span class='pre'>timeStyle</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a locale specific time format for the ISO chronology. ...</div><div class='long'><p>Returns a locale specific time format for the ISO chronology.\n <p>\n This returns a formatter that will format or parse a time.\n The exact format pattern used varies by locale.\n <p>\n The locale is determined from the formatter. The formatter returned directly by\n this method will use the default FORMAT locale.\n The locale can be controlled using withLocale(Locale)\n on the result of this method.\n <p>\n Note that the localized pattern is looked up lazily.\n This {@code DateTimeFormatter} holds the style required and the locale,\n looking up the pattern required on demand.\n <p>\n The returned formatter has a chronology of ISO set to ensure dates in\n other calendar systems are correctly converted.\n It has no override zone and uses the <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>timeStyle</span> : Object {FormatStyle}<div class='sub-desc'><p>the formatter style to obtain, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>the time formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-ofPattern' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-ofPattern' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-ofPattern' class='name expandable'>ofPattern</a>( <span class='pre'>pattern, locale</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Creates a formatter using the specified pattern and locale. ...</div><div class='long'><p>Creates a formatter using the specified pattern and locale.\n <p>\n This method will create a formatter based on a simple\n <a href=\"#patterns\">pattern of letters and symbols</a>\n as described in the class documentation.\n For example, {@code d MMM uuuu} will format 2011-12-03 as '3 Dec 2011'.\n <p>\n The formatter will use the specified locale.\n This can be changed using withLocale(Locale) on the returned formatter\n <p>\n The returned formatter has no override chronology or zone.\n It uses <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>pattern</span> : String<div class='sub-desc'><p>the pattern to use, not null</p>\n</div></li><li><span class='pre'>locale</span> : Object {Locale}<div class='sub-desc'><p>the locale to use, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>the formatter based on the pattern, not null</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>IllegalArgumentException if the pattern is invalid\n@see DateTimeFormatterBuilder#appendPattern(String)</p>\n</div></li></ul></div></div></div><div id='method-parse' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-parse' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-parse' class='name expandable'>parse</a>( <span class='pre'>text, query, query</span> ) : Object {java.lang.Object}<span class=\"signature\"></span></div><div class='description'><div class='short'>Fully parses the text producing an object of the specified type. ...</div><div class='long'><p>Fully parses the text producing an object of the specified type.\n <p>\n Most applications should use this method for parsing.\n It parses the entire text to produce the required date-time.\n The query is typically a method reference to a {@code from(TemporalAccessor)} method.\n For example:</p>\n\n<pre>  LocalDateTime dt = parser.parse(str, LocalDateTime::from);\n </pre>\n\n\n<p> If the parse completes without reading the entire length of the text,\n or a problem occurs during parsing or merging, then an exception is thrown.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>text</span> : Object {CharSequence}<div class='sub-desc'><p>the text to parse, not null</p>\n</div></li><li><span class='pre'>query</span> : Object {java.time.temporal.TemporalQuery}<div class='sub-desc'><p>the query defining the type to parse to, not null</p>\n</div></li><li><span class='pre'>query</span> : Object<div class='sub-desc'><p>the query defining the type to parse to, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.lang.Object}</span><div class='sub-desc'><p>the parsed date-time, not null</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>DateTimeParseException if unable to parse the requested result</p>\n</div></li></ul></div></div></div><div id='method-parseBest' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-parseBest' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-parseBest' class='name expandable'>parseBest</a>( <span class='pre'>text, queries</span> ) : Object {java.time.temporal.TemporalAccessor}<span class=\"signature\"></span></div><div class='description'><div class='short'>Fully parses the text producing an object of one of the specified types. ...</div><div class='long'><p>Fully parses the text producing an object of one of the specified types.\n <p>\n This parse method is convenient for use when the parser can handle optional elements.\n For example, a pattern of 'uuuu-MM-dd HH.mm[ VV]' can be fully parsed to a {@code ZonedDateTime},\n or partially parsed to a {@code LocalDateTime}.\n The queries must be specified in order, starting from the best matching full-parse option\n and ending with the worst matching minimal parse option.\n The query is typically a method reference to a {@code from(TemporalAccessor)} method.\n <p>\n The result is associated with the first type that successfully parses.\n Normally, applications will use {@code instanceof} to check the result.\n For example:</p>\n\n<pre>  TemporalAccessor dt = parser.parseBest(str, ZonedDateTime::from, LocalDateTime::from);\n  if (dt instanceof ZonedDateTime) {\n   ...\n  } else {\n   ...\n  }\n </pre>\n\n\n<p> If the parse completes without reading the entire length of the text,\n or a problem occurs during parsing or merging, then an exception is thrown.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>text</span> : Object {CharSequence}<div class='sub-desc'><p>the text to parse, not null</p>\n</div></li><li><span class='pre'>queries</span> : Object {java.time.temporal.TemporalQuery[]}<div class='sub-desc'><p>the queries defining the types to attempt to parse to,\n  must implement {@code TemporalAccessor}, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.temporal.TemporalAccessor}</span><div class='sub-desc'><p>the parsed date-time, not null</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>IllegalArgumentException if less than 2 types are specified</p>\n</div></li><li><span class='pre'>Object</span><div class='sub-desc'><p>DateTimeParseException if unable to parse the requested result</p>\n</div></li></ul></div></div></div><div id='method-parseUnresolved' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-parseUnresolved' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-parseUnresolved' class='name expandable'>parseUnresolved</a>( <span class='pre'>text, position</span> ) : Object {java.time.temporal.TemporalAccessor}<span class=\"signature\"></span></div><div class='description'><div class='short'>Parses the text using this formatter, without resolving the result, intended\n for advanced use cases. ...</div><div class='long'><p>Parses the text using this formatter, without resolving the result, intended\n for advanced use cases.\n <p>\n Parsing is implemented as a two-phase operation.\n First, the text is parsed using the layout defined by the formatter, producing\n a {@code Map} of field to value, a {@code ZoneId} and a {@code Chronology}.\n Second, the parsed data is <em>resolved</em>, by validating, combining and\n simplifying the various fields into more useful ones.\n This method performs the parsing stage but not the resolving stage.\n <p>\n The result of this method is {@code TemporalAccessor} which represents the\n data as seen in the input. Values are not validated, thus parsing a date string\n of '2012-00-65' would result in a temporal with three fields - year of '2012',\n month of '0' and day-of-month of '65'.\n <p>\n The text will be parsed from the specified start {@code ParsePosition}.\n The entire length of the text does not have to be parsed, the {@code ParsePosition}\n will be updated with the index at the end of parsing.\n <p>\n Errors are returned using the error index field of the {@code ParsePosition}\n instead of {@code DateTimeParseException}.\n The returned error index will be set to an index indicative of the error.\n Callers must check for errors before using the result.\n <p>\n If the formatter parses the same field more than once with different values,\n the result will be an error.\n <p>\n This method is intended for advanced use cases that need access to the\n internal state during parsing. Typical application code should use\n TemporalQuery) or the parse method on the target type.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>text</span> : Object {CharSequence}<div class='sub-desc'><p>the text to parse, not null</p>\n</div></li><li><span class='pre'>position</span> : Object {ParsePosition}<div class='sub-desc'><p>the position to parse from, updated with length parsed\n  and the index of any error, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.temporal.TemporalAccessor}</span><div class='sub-desc'><p>the parsed text, null if the parse results in an error</p>\n</div></li></ul><h3 class='pa'>Throws</h3><ul><li><span class='pre'>Object</span><div class='sub-desc'><p>DateTimeException if some problem occurs during parsing</p>\n</div></li><li><span class='pre'>Object</span><div class='sub-desc'><p>IndexOutOfBoundsException if the position is invalid</p>\n</div></li></ul></div></div></div><div id='method-parsedExcessDays' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-parsedExcessDays' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-parsedExcessDays' class='name expandable'>parsedExcessDays</a>( <span class='pre'></span> ) : Object {java.time.temporal.TemporalQuery}<span class=\"signature\"></span></div><div class='description'><div class='short'>A query that provides access to the excess days that were parsed. ...</div><div class='long'><p>A query that provides access to the excess days that were parsed.\n <p>\n This returns a singleton {@linkplain TemporalQuery query} that provides\n access to additional information from the parse. The query always returns\n a non-null period, with a zero period returned instead of null.\n <p>\n There are two situations where this query may return a non-zero period.\n <ul>\n <li>If the {@code ResolverStyle} is {@code LENIENT} and a time is parsed\n  without a date, then the complete result of the parse consists of a\n  {@code LocalTime} and an excess {@code Period} in days.</li></ul></p>\n\n<p> <li>If the {@code ResolverStyle} is {@code SMART} and a time is parsed\n  without a date where the time is 24:00:00, then the complete result of\n  the parse consists of a {@code LocalTime} of 00:00:00 and an excess\n  {@code Period} of one day.\n \n <p>\n In both cases, if a complete {@code ChronoLocalDateTime} or {@code Instant}\n is parsed, then the excess days are added to the date part.\n As a result, this query will return a zero period.\n <p>\n The {@code SMART} behaviour handles the common \"end of day\" 24:00 value.\n Processing in {@code LENIENT} mode also produces the same result:</p>\n\n<pre>  Text to parse        Parsed object                         Excess days\n  \"2012-12-03T00:00\"   LocalDateTime.of(2012, 12, 3, 0, 0)   ZERO\n  \"2012-12-03T24:00\"   LocalDateTime.of(2012, 12, 4, 0, 0)   ZERO\n  \"00:00\"              LocalTime.of(0, 0)                    ZERO\n  \"24:00\"              LocalTime.of(0, 0)                    Period.ofDays(1)\n </pre>\n\n\n<p> The query can be used as follows:</p>\n\n<pre>  TemporalAccessor parsed = formatter.parse(str);\n  LocalTime time = parsed.query(LocalTime::from);\n  Period extraDays = parsed.query(DateTimeFormatter.parsedExcessDays());\n </pre>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.temporal.TemporalQuery}</span><div class='sub-desc'><p>a query that provides access to the excess days that were parsed</p>\n</div></li></ul></div></div></div><div id='method-parsedLeapSecond' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-parsedLeapSecond' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-parsedLeapSecond' class='name expandable'>parsedLeapSecond</a>( <span class='pre'></span> ) : Object {java.time.temporal.TemporalQuery}<span class=\"signature\"></span></div><div class='description'><div class='short'>A query that provides access to whether a leap-second was parsed. ...</div><div class='long'><p>A query that provides access to whether a leap-second was parsed.\n <p>\n This returns a singleton {@linkplain TemporalQuery query} that provides\n access to additional information from the parse. The query always returns\n a non-null boolean, true if parsing saw a leap-second, false if not.\n <p>\n Instant parsing handles the special \"leap second\" time of '23:59:60'.\n Leap seconds occur at '23:59:60' in the UTC time-zone, but at other\n local times in different time-zones. To avoid this potential ambiguity,\n the handling of leap-seconds is limited to\n java.time.format.DateTimeFormatterBuilder.appendInstant(), as that method\n always parses the instant with the UTC zone offset.\n <p>\n If the time '23:59:60' is received, then a simple conversion is applied,\n replacing the second-of-minute of 60 with 59. This query can be used\n on the parse result to determine if the leap-second adjustment was made.\n The query will return {@code true} if it did adjust to remove the\n leap-second, and {@code false} if not. Note that applying a leap-second\n smoothing mechanism, such as UTC-SLS, is the responsibility of the\n application, as follows:</p>\n\n<pre>  TemporalAccessor parsed = formatter.parse(str);\n  Instant instant = parsed.query(Instant::from);\n  if (parsed.query(DateTimeFormatter.parsedLeapSecond())) {\n    // validate leap-second is correct and apply correct smoothing\n  }\n </pre>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.temporal.TemporalQuery}</span><div class='sub-desc'><p>a query that provides access to whether a leap-second was parsed</p>\n</div></li></ul></div></div></div><div id='method-toFormat' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-toFormat' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-toFormat' class='name expandable'>toFormat</a>( <span class='pre'>parseQuery</span> ) : Object {java.text.Format}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns this formatter as a {@code java.text.Format} instance that will\n parse using the specified query. ...</div><div class='long'><p>Returns this formatter as a {@code java.text.Format} instance that will\n parse using the specified query.\n <p>\n The returned Format instance will format any TemporalAccessor\n and parses to the type specified.\n The type must be one that is supported by <a href=\"#!/api/java.time.format.DateTimeFormatter-method-parse\" rel=\"java.time.format.DateTimeFormatter-method-parse\" class=\"docClass\">parse</a>.\n <p>\n Exceptions will follow the definitions of {@code Format}, see those methods\n for details about {@code IllegalArgumentException} during formatting and\n {@code ParseException} or null during parsing.\n The format does not support attributing of the returned format string.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>parseQuery</span> : Object {java.time.temporal.TemporalQuery}<div class='sub-desc'><p>the query defining the type to parse to, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.text.Format}</span><div class='sub-desc'><p>this formatter as a classic format instance, not null</p>\n</div></li></ul></div></div></div><div id='method-toString' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-toString' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-toString' class='name expandable'>toString</a>( <span class='pre'></span> ) : String<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a description of the underlying formatters. ...</div><div class='long'><p>Returns a description of the underlying formatters.</p>\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'><p>a description of this formatter, not null</p>\n</div></li></ul></div></div></div><div id='method-withChronology' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-withChronology' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-withChronology' class='name expandable'>withChronology</a>( <span class='pre'>chrono</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a copy of this formatter with a new override chronology. ...</div><div class='long'><p>Returns a copy of this formatter with a new override chronology.\n <p>\n This returns a formatter with similar state to this formatter but\n with the override chronology set.\n By default, a formatter has no override chronology, returning null.\n <p>\n If an override is added, then any date that is formatted or parsed will be affected.\n <p>\n When formatting, if the temporal object contains a date, then it will\n be converted to a date in the override chronology.\n Whether the temporal contains a date is determined by querying the\n EPOCH_DAY field.\n Any time or zone will be retained unaltered unless overridden.\n <p>\n If the temporal object does not contain a date, but does contain one\n or more {@code ChronoField} date fields, then a {@code DateTimeException}\n is thrown. In all other cases, the override chronology is added to the temporal,\n replacing any previous chronology, but without changing the date/time.\n <p>\n When parsing, there are two distinct cases to consider.\n If a chronology has been parsed directly from the text, perhaps because\n java.time.format.DateTimeFormatterBuilder.appendChronologyId() was used, then\n this override chronology has no effect.\n If no zone has been parsed, then this override chronology will be used\n to interpret the {@code ChronoField} values into a date according to the\n date resolving rules of the chronology.\n <p>\n This instance is immutable and unaffected by this method call.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>chrono</span> : Object {Chronology}<div class='sub-desc'><p>the new chronology, null if no override</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>a formatter based on this formatter with the requested override chronology, not null</p>\n</div></li></ul></div></div></div><div id='method-withDecimalStyle' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-withDecimalStyle' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-withDecimalStyle' class='name expandable'>withDecimalStyle</a>( <span class='pre'>decimalStyle</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a copy of this formatter with a new DecimalStyle. ...</div><div class='long'><p>Returns a copy of this formatter with a new DecimalStyle.\n <p>\n This instance is immutable and unaffected by this method call.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>decimalStyle</span> : Object {DecimalStyle}<div class='sub-desc'><p>the new DecimalStyle, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>a formatter based on this formatter with the requested DecimalStyle, not null</p>\n</div></li></ul></div></div></div><div id='method-withLocale' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-withLocale' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-withLocale' class='name expandable'>withLocale</a>( <span class='pre'>locale</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a copy of this formatter with a new locale. ...</div><div class='long'><p>Returns a copy of this formatter with a new locale.\n <p>\n This is used to lookup any part of the formatter needing specific\n localization, such as the text or localized pattern.\n <p>\n This instance is immutable and unaffected by this method call.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>locale</span> : Object {Locale}<div class='sub-desc'><p>the new locale, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>a formatter based on this formatter with the requested locale, not null</p>\n</div></li></ul></div></div></div><div id='method-withResolverFields' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-withResolverFields' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-withResolverFields' class='name expandable'>withResolverFields</a>( <span class='pre'>resolverFields</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a copy of this formatter with a new set of resolver fields. ...</div><div class='long'><p>Returns a copy of this formatter with a new set of resolver fields.\n <p>\n This returns a formatter with similar state to this formatter but with\n the resolver fields set. By default, a formatter has no resolver fields.\n <p>\n Changing the resolver fields only has an effect during parsing.\n Parsing a text string occurs in two phases.\n Phase 1 is a basic text parse according to the fields added to the builder.\n Phase 2 resolves the parsed field-value pairs into date and/or time objects.\n The resolver fields are used to filter the field-value pairs between phase 1 and 2.\n <p>\n This can be used to select between two or more ways that a date or time might\n be resolved. For example, if the formatter consists of year, month, day-of-month\n and day-of-year, then there are two ways to resolve a date.\n Calling this method with the arguments YEAR and\n DAY_OF_YEAR will ensure that the date is\n resolved using the year and day-of-year, effectively meaning that the month\n and day-of-month are ignored during the resolving phase.\n <p>\n In a similar manner, this method can be used to ignore secondary fields that\n would otherwise be cross-checked. For example, if the formatter consists of year,\n month, day-of-month and day-of-week, then there is only one way to resolve a\n date, but the parsed value for day-of-week will be cross-checked against the\n resolved date. Calling this method with the arguments YEAR,\n MONTH_OF_YEAR and\n DAY_OF_MONTH will ensure that the date is\n resolved correctly, but without any cross-check for the day-of-week.\n <p>\n In implementation terms, this method behaves as follows. The result of the\n parsing phase can be considered to be a map of field to value. The behavior\n of this method is to cause that map to be filtered between phase 1 and 2,\n removing all fields other than those specified as arguments to this method.\n <p>\n This instance is immutable and unaffected by this method call.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>resolverFields</span> : Object {java.util.Set}<div class='sub-desc'><p>the new set of resolver fields, null if no fields</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>a formatter based on this formatter with the requested resolver style, not null</p>\n</div></li></ul></div></div></div><div id='method-withResolverStyle' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-withResolverStyle' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-withResolverStyle' class='name expandable'>withResolverStyle</a>( <span class='pre'>resolverStyle</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a copy of this formatter with a new resolver style. ...</div><div class='long'><p>Returns a copy of this formatter with a new resolver style.\n <p>\n This returns a formatter with similar state to this formatter but\n with the resolver style set. By default, a formatter has the\n <a href=\"#!/api/java.time.format.ResolverStyle-property-SMART\" rel=\"java.time.format.ResolverStyle-property-SMART\" class=\"docClass\">SMART</a> resolver style.\n <p>\n Changing the resolver style only has an effect during parsing.\n Parsing a text string occurs in two phases.\n Phase 1 is a basic text parse according to the fields added to the builder.\n Phase 2 resolves the parsed field-value pairs into date and/or time objects.\n The resolver style is used to control how phase 2, resolving, happens.\n See {@code ResolverStyle} for more information on the options available.\n <p>\n This instance is immutable and unaffected by this method call.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>resolverStyle</span> : Object {ResolverStyle}<div class='sub-desc'><p>the new resolver style, not null</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>a formatter based on this formatter with the requested resolver style, not null</p>\n</div></li></ul></div></div></div><div id='method-withZone' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='java.time.format.DateTimeFormatter'>java.time.format.DateTimeFormatter</span><br/><a href='source/DateTimeFormatter.html#java-time-format-DateTimeFormatter-method-withZone' target='_blank' class='view-source'>view source</a></div><a href='#!/api/java.time.format.DateTimeFormatter-method-withZone' class='name expandable'>withZone</a>( <span class='pre'>zone</span> ) : Object {java.time.format.DateTimeFormatter}<span class=\"signature\"></span></div><div class='description'><div class='short'>Returns a copy of this formatter with a new override zone. ...</div><div class='long'><p>Returns a copy of this formatter with a new override zone.\n <p>\n This returns a formatter with similar state to this formatter but\n with the override zone set.\n By default, a formatter has no override zone, returning null.\n <p>\n If an override is added, then any instant that is formatted or parsed will be affected.\n <p>\n When formatting, if the temporal object contains an instant, then it will\n be converted to a zoned date-time using the override zone.\n Whether the temporal is an instant is determined by querying the\n INSTANT_SECONDS field.\n If the input has a chronology then it will be retained unless overridden.\n If the input does not have a chronology, such as {@code Instant}, then\n the ISO chronology will be used.\n <p>\n If the temporal object does not contain an instant, but does contain\n an offset then an additional check is made. If the normalized override\n zone is an offset that differs from the offset of the temporal, then\n a {@code DateTimeException} is thrown. In all other cases, the override\n zone is added to the temporal, replacing any previous zone, but without\n changing the date/time.\n <p>\n When parsing, there are two distinct cases to consider.\n If a zone has been parsed directly from the text, perhaps because\n java.time.format.DateTimeFormatterBuilder.appendZoneId() was used, then\n this override zone has no effect.\n If no zone has been parsed, then this override zone will be included in\n the result of the parse where it can be used to build instants and date-times.\n <p>\n This instance is immutable and unaffected by this method call.</p>\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>zone</span> : Object {ZoneId}<div class='sub-desc'><p>the new override zone, null if no override</p>\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Object {java.time.format.DateTimeFormatter}</span><div class='sub-desc'><p>a formatter based on this formatter with the requested override zone, not null</p>\n</div></li></ul></div></div></div></div></div></div></div>","meta":{}});